function ReviewForm(props) {
    return (
      <div>
        {reviews.map((review) => {
          <article className="book-review">
            <h2>{review.title}</h2>
            <h3>{review.author}</h3>
            <p>hello</p>
            <p>Image... {review.stars}</p>
            <h4>{review.review}</h4>
            <h5>{review.date}</h5>
          </article>;
        })}
      </div>
    );
}

export default ReviewForm
